'''Araxytes''', known simply as "spider" in-game, are [[venom]]ous spiders found in the [[Morytania Spider Nest]]. As they are abundant in numbers, able to inflict [[venom]], and in a [[multicombat area]], it is dangerous to fight them without prayer or a method to stave off venom.

During [[A Night at the Theatre]], four of them attack the player upon obtaining some [[strange spider eggs]].

